import Layout from '../components/Layout';
import Image from 'next/image';

const Index = () => (
  <Layout>
    <div>
      <h1>Jillian Gibson</h1>
      <p>Software Engineer</p>
      <Image
      src="../assets/carin.jpg"
      alt='stacked rock carin'
      width
      />
    </div>
  </Layout>
);

export default Index;
